DROP TABLE IF EXISTS "main"."cdp_neighbors";
DROP TABLE IF EXISTS "main"."ifce_descriptions";
DROP TABLE IF EXISTS "main"."ifce_status";
DROP TABLE IF EXISTS "main"."mac_addresses";
DROP TABLE IF EXISTS "main"."macs_to_ips";
